import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
fetch("http://localhost:9000/timer")
  .then((res) => res.text())
  .then((res) => {
    console.log("res: " + JSON.stringify(res));
  });

class App extends Component {
  constructor(props) {
    //TODO
    super(props);
    this.state = { time: "" };
    this.callAPI();
    console.log("in constructor" + this.state.apiResponse);
  }

  callAPI() {
    console.log("in callAPI");
    const options = {
      headers: { "Access-Control-Allow-Origin": "*" },
    };
    fetch("http://localhost:9000/timer/")
      .then((res) => res.text())
      .then((res) => {
        console.log("res: " + JSON.stringify(res));
        this.setState({ time: res.timerValue });
        console.log(this.state);
      });
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p className="App-intro">{this.state.time}</p>
          <p>Hello Boozer!</p>
        </header>
      </div>
    );
  }
}

export default App;
